import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div class="social">
            <a href="https://github.com/Whleee" target="_blank" rel="noopener noreferrer"><i class="fab fa-github fa-lg"></i></a>
            <a href="https://www.instagram.com/whlee_/" target="_blank" rel="noopener noreferrer"><i class="fab fa-instagram"></i></a>
            <a href="https://www.linkedin.com/in/lee-wei-heng-60b61717b/" target="_blank" rel="noopener noreferrer"><i class="fab fa-linkedin-in"></i></a>
            </div>
            )
        }
    }

export default Social
